#include <stdio.h>
#include <string.h>
#include "tcp_server.h"

#define UNUSE(X) (void)X

static int on_connect(peer_t* peer, struct sockaddr_storage* addr) {
    UNUSE(peer);
    UNUSE(addr);
    return 0;
}

static int on_read(peer_t* peer, char *buf, size_t length) {
    UNUSE(buf);
    UNUSE(length);
    char* response = "HTTP/1.0 200 OK\r\n"
"Date: Fri, 16 Dec 2016 03:51:21 GMT\r\n"
"Server: c\r\n"
"Content-Type: text/plain; charset=utf-8\r\n"
"Connection: Close\r\n"
"Content-Length: 100000\r\n"
"\r\n"
"";
    peer_send(peer, response, strlen(response));
    return -1;
}

static void on_close(peer_t* peer) {
    UNUSE(peer);
}

int run_http_server(const char *node, const char *service, int backlog) {
    conf_t conf;
    conf.node = node;
    conf.service = service;
    conf.backlog = backlog;
    conf.num_threads = 0;
    conf.num_read_buffer = 8192;
    conf.num_read_timeout = 1000;
    conf.num_max_connection = 1000;
    conf.on_connect = on_connect;
    conf.on_read = on_read;
    conf.on_close = on_close;
    return run_tcp_server(&conf);
}
